#include "Crosshair.h"
#include "shonaxsettings.h"
#include "XorStr.hpp"
Crosshair crosshair;

void Crosshair::paint() {
	
	if (Shonax::settingsxd.spreadcrosshair && Shonax::settingsxd.spreadcrosshairtype==0) {
		auto m_local = game::localdata.localplayer();
	
		if (m_local && m_local->IsAlive()) {
			auto m_weapon = m_local->GetWeapon();
			if (!m_weapon || m_weapon->IsKnife()) return;

			int xs, ys;
			m_pEngine->GetScreenSize(xs, ys);
			xs /= 2; ys /= 2;

			auto accuracy = m_weapon->GetCone() * 550.f;
			draw.filled_circle(xs, ys, 30, accuracy, Color(27, 27, 27, 140));
		}
	}

	if (Shonax::settingsxd.espreticle) {

		m_pEngine->ClientCmd_Unrestricted(XorStr("crosshair 0"));

		auto m_local = game::localdata.localplayer();

		if (m_local && m_local->IsAlive()) {
			float damage;

			int xs, ys;
			m_pEngine->GetScreenSize(xs, ys);
			xs /= 2; ys /= 2;

			draw.outlined_rect(xs - 2, ys - 2, 5, 5, Color(27, 27, 27), trace_autowallable(damage) ? Color(130, 241, 13) : Color(255, 102, 102));
		}
	}
	else 
	{
		m_pEngine->ClientCmd_Unrestricted(XorStr("crosshair 1"));
	}
	if (Shonax::settingsxd.espdamagereticle) {
		auto m_local = game::localdata.localplayer();

		if (m_local && m_local->IsAlive()) {
			float damage = 0.f;

			int xs, ys;
			m_pEngine->GetScreenSize(xs, ys);
			xs /= 2; ys /= 2;

			if (trace_autowallable(damage)) {

				draw.textf(xs - 4, ys - 25, Color(255, 255, 255, 255), draw.fonts.esp, "%.1f", damage);

			}
		}
	}
}

